class testpoint(unittest.TestCase):
	
	def test_weather_response(self):
		"""matches the return value of the function 'weather_response' for different locations with corresponding json strings provided above"""
		self.assertEqual(weather_response("Delhi"),json1)
		self.assertEqual(weather_response("Jaipur","2ab136be1543b5789451a5994364c0d3"),json2)
		self.assertEqual(weather_response("new york"),json3)
		self.assertEqual(weather_response("Sydney","2ab136be1543b5789451a5994364c0d3"),json4)
		self.assertEqual(weather_response("Japan"),json5)

	def test_has_error(self):
		"""tests if the return value of function 'has_error' is True for different location names"""
		self.assertTrue(has_error("delh",json1))
		self.assertTrue(has_error("@#$%",json2))
		self.assertTrue(has_error("new_york",json3))
		self.assertTrue(has_error("abcdef",json4))
		self.assertTrue(has_error("123",json5))

	def test_get_temperature(self):
		"""matches the return value of function 'get_temperature' with actual values ignoring 5% error"""
		self.assertAlmostEqual(get_temperature (weather_response("Delhi"), n=0,t="21:00:00"),298.667,delta=5)
		self.assertAlmostEqual(get_temperature (weather_response("Jaipur"), n=1),297.159,delta=5)
		self.assertAlmostEqual(get_temperature (weather_response("new york"), n=2,t="06:00:00"),289.676,delta=5)
		self.assertAlmostEqual(get_temperature (weather_response("Sydney"), n=3,t="09:00:00"),291.758,delta=5)
		self.assertAlmostEqual(get_temperature (weather_response("Japan"), n=4,t="18:00:00"),293.37,delta=5)
	
	def test_get_humidity(self):
		"""matches the return value of function 'get_humidity' with actual values ignoring 5% error"""
		self.assertAlmostEqual(get_humidity(weather_response("Delhi"), n=0,t="21:00:00"),93,delta=5)
		self.assertAlmostEqual(get_humidity(weather_response("Jaipur"), n=1),100,delta=5)
		self.assertAlmostEqual(get_humidity(weather_response("new york"), n=2,t="06:00:00"),100,delta=5)
		self.assertAlmostEqual(get_humidity(weather_response("Sydney"), n=3,t="09:00:00"),71,delta=5)
		self.assertAlmostEqual(get_humidity(weather_response("Japan"), n=4,t="18:00:00"),94,delta=5)

	def test_get_pressure(self):
		"""matches the return value of function 'get_temperature' with actual values ignoring 5% error"""
		self.assertAlmostEqual(get_pressure(weather_response("Delhi"), n=0,t="21:00:00"),992.54,delta=5)
		self.assertAlmostEqual(get_pressure(weather_response("Jaipur"), n=1),970.14,delta=5)
		self.assertAlmostEqual(get_pressure(weather_response("new york"), n=2,t="06:00:00"),1033.12,delta=5)
		self.assertAlmostEqual(get_pressure(weather_response("Sydney"), n=3,t="09:00:00"),1026.72,delta=5)
		self.assertAlmostEqual(get_pressure(weather_response("Japan"), n=4,t="18:00:00"),980.21,delta=5)
	
	def test_get_wind(self):
		"""matches the return value of function 'get_temperature' with actual values ignoring 5% error"""
		self.assertAlmostEqual(get_wind(weather_response("Delhi"), n=0,t="21:00:00"),3.8,delta=5)
		self.assertAlmostEqual(get_wind(weather_response("Jaipur"), n=1),4.01,delta=5)
